import axios from "axios";

export const createSnowman = async () => {
    // const mapNumber = locatorIdState;
    const token = localStorage.getItem("token");
    console.log("<< createSnowman test >>");
    if (!token) {
    console.log("Token not found");
    return;
    }
 
    try {
    const response = await axios.post(`https://nuneddine.p-e.kr/api/v1/map/1/snowman`, 
{
    "name": "사눈람",
    "snowmanShape": "BASIC",
    "image": "data:image/png;base64,",
    "posX": 218.3125,
    "posY": 199.546875,
    "quiz": "이 눈사람 주인의 생일은?",
    "answerId": 1,
     "content1": "4월 11일",
     "content2": "12월 25일",
     "content3": "3월 17일"
}
    , 
    {
       headers: {
          Authorization: `Bearer ${token}`,
       },
    });
    console.log(response);
    } catch (error: any) {
    console.error("Failed to create snowman", error);
 
    // 에러 객체에서 응답 데이터 추출
    if (error.response && error.response.data) {
       console.log("Error message:", error.response.data.message);
    } else {
       console.log("An unexpected error occurred.");
    }
    }
 };